import React from "react";

import { useSelector } from "react-redux";

const AxiosFunction = () => {
  const { posts } = useSelector((state) => ({ posts: state.Post.posts }));

  console.log("posts", posts);

  return (
    <div>
      {posts.map((item) => (
        <li>
          <div>{item.id}</div>
          <div>{item.title}</div>
        </li>
      ))}
    </div>
  );
};

export default AxiosFunction;
